// Node module: apim-ui

'use strict';

/* Directives */

var sslProfiles = angular.module('apim.tls');

sslProfiles.directive('apimSslprofile', function() {
  return {
    restrict: 'E',
    templateUrl: 'apim/ssl/partials/sslProfile.html'
  };
});

sslProfiles.directive('apimCertdetails', function() {
  return {
    restrict: 'E',
    templateUrl: 'apim/ssl/partials/certificateDetails.html'
  };
});

sslProfiles.directive('apicUploadCert', function() {
  return {
    restrict: 'E',
    templateUrl: 'apim/ssl/partials/upload-cert-inline.html'
  };
});

